import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { useAuth0 } from "@auth0/auth0-react"; // Importar useAuth0 para la autenticación
import Header from './components/Header'; // Importación del Header
import Home from './components/Home'; // Importación de la página Home
import Service from './components/Service'; // Importación de la página Service
import Recipes from './components/Recipes'; // Importación de la página Recipes
import Restaurants from './components/Restaurants'; // Importación de la página Restaurants

import { LoginButton } from "./components/Login"; // Importación del botón Login
import { LogoutButton } from "./components/Logout"; // Importación del botón Logout
import { Profile } from "./components/Profile"; // Importación del perfil
import logo from "./logo.svg";
import "./App.css";

function App() {
  const { isAuthenticated } = useAuth0(); // Obtener el estado de autenticación

  return (
    <div className="App">
      <Router>
        <Header />
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          {isAuthenticated ? (
            <>
              <Profile />
              <LogoutButton />
            </>
          ) : (
            <LoginButton />
          )}
        </header>

        <div className="content">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/service" element={<Service />} />
            <Route path="/recipes" element={<Recipes />} />
            <Route path="/restaurants" element={<Restaurants />} />
          </Routes>
        </div>
      </Router>
    </div>
  );
}

export default App;
